Moviework.create!([
  {overview: "Peace in 17th-century Japan causes the Shogunate's breakup of warrior clans, throwing thousands of samurai out of work and into poverty. An honorable end to such fate under the samurai code is ritual suicide, or hara-kiri.", release_date: "1962-09-15", medium: "Movie", unique_id: 14537, original_title: "Seppuku", poster_path: "/99EyyBq5dXEvY37jF7EyERhQcFe.jpg", backdrop_path: "/dT51Ul1GN5HSOVokDnnCk54VkdA.jpg", title: "Harakiri", vote_avg: 7.16},
  {overview: "A woman struggles to find a way to live her life after the death of her husband and child.", release_date: "1993-01-10", medium: "Movie", unique_id: 108, original_title: "Trois couleurs : Bleu", poster_path: "/vJKU6MCJJXdQz7suBTulvjWcKWJ.jpg", backdrop_path: "/dIXPijiNZ9JsMaFWD67bFwUtZdo.jpg", title: "Three Colors: Blue", vote_avg: 7.37},
  {overview: "Red This is the third film from the trilogy by Kieślowski. “Red” meaning brotherliness. Here Kieślowski masterly tells strange coincidentally linked stories in the most packed work.", release_date: "1994-09-14", medium: "Movie", unique_id: 110, original_title: "Trois couleurs : Rouge", poster_path: "/klFrlf8XmwmIVvy9NcPNBQMyxps.jpg", backdrop_path: "/nL5wZvZjAi11kP9HSWYIdyiGhN8.jpg", title: "Three Colors: Red", vote_avg: 7.54},
  {overview: "Lola receives a phone call from her boyfriend Manny. He lost 100,000 DM in a subway train that belongs to a very bad guy. She has 20 minutes to raise this amount and meet Manny. Otherwise, he will rob a store to get the money. Three different alternatives may happen depending on some minor event along Lola's run.", release_date: "1998-08-20", medium: "Movie", unique_id: 104, original_title: "Lola rennt", poster_path: "/3L8QhF5IkZOnEnBFdpj6GVkkp7d.jpg", backdrop_path: "/xzbAey8RrRNKOe6JZMuxbIRc1UE.jpg", title: "Run Lola Run", vote_avg: 7.09},
  {overview: "Ray and Ken, two hit men, are in Bruges, Belgium, waiting for their next mission. While they are there they have time to think and discuss their previous assignment. When the mission is revealed to Ken, it is not what he expected.", release_date: "2008-02-08", medium: "Movie", unique_id: 8321, original_title: "In Bruges", poster_path: "/kBABboeLU2HsKWSG7DwiF9saHl5.jpg", backdrop_path: "/rGxc09T1jXk98HforvqhBaHIaRW.jpg", title: "In Bruges", vote_avg: 7.21},
  {overview: "After he is threatened during a confession, a good-natured priest must battle the dark forces closing in around him.", release_date: "2014-04-11", medium: "Movie", unique_id: 157832, original_title: "Calvary", poster_path: "/fxu3NT8PMCoPG0QLr0j6KoleSp.jpg", backdrop_path: "/oPDiCIdNsECwJJg5pdqRd6d5k6C.jpg", title: "Calvary", vote_avg: 7.06},
  {overview: "A melancholy story about the love between a woman and a man who live in the same building and one day find out that their husband and wife had an affair with each other. More and more the two meet during their daily lives as they determine that they both don’t want to be lonely in their marriage.", release_date: "2000-05-22", medium: "Movie", unique_id: 843, original_title: "Fa yeung nin wa", poster_path: "/unOW3SxFxBdd7LMWjmRONdHWKPb.jpg", backdrop_path: "/fAA0S3rM3o5Sp8TIdS0MvWOGsCQ.jpg", title: "In the Mood for Love", vote_avg: 7.48},
  {overview: "Set in the rainy environs of Oregon and Washington, Punk Love is the story of two forlorn lovers, searching for that elusive Hollywood Ending to the story of their dreams. Sarah is a lost 15-year-old, trapped in an unloving home, in a dreary small paper mill town. When she meets Spike, she envisions a new life for herself. Falling in love, Sarah and Spike go on a crime spree of small-time con jobs, both to support themselves and their drug habit. Spike has dreams of his own, and when he successfully auditions for a band, he can't help but feel that he and Sarah are starting on the road to escaping their ill-fated existence. But just as things are looking up, everything goes uncontrollably wrong, and Spike and Sarah have only their undying love for each other as a means of survival against all odds. Director/writer Nick Lyon's Punk Love is a modern-day fairy tale about two fallen angels searching for meaning in a world without pity...", release_date: "2006-03-04", medium: "Movie", unique_id: 83939, original_title: "Punk Love", poster_path: "/bv8yMGgOEePExNwfNGkW2qWd9s7.jpg", backdrop_path: "/hjxzA9vfSUqxsksLKAjTHYtqQdi.jpg", title: "Punk Love", vote_avg: 5.25},
  {overview: "Walter is the chief of police in a small Ontario town that has its first murder victim, an attractive young woman who is found naked on the shores of the nearby lake. The woman isn't local and while the Ontario Provincial Police have taken the lead in the investigation, Walter assists where he can. The town is mostly a close-knit Mennonite community and Walter has recently returned to his church. He is also trying to deal with his own temper that led to a violent incident some months before. As the young woman is identified, it becomes apparent that Walter's former love interest may be lying.", release_date: "2010-09-14", medium: "Movie", unique_id: 69794, original_title: "Small Town Murder Songs", poster_path: "/vgNxG4NQuvVoXOPtcNoVofZbwk4.jpg", backdrop_path: "/vWrp42vyBzNyb3mJohqpz09pzCI.jpg", title: "Small Town Murder Songs", vote_avg: 5.0},
  {overview: "Uncle John revolves around the struggle to keep a mysterious disappearance unsolved", release_date: "2015-03-16", medium: "Movie", unique_id: 324150, original_title: "Uncle John", poster_path: "/ga4CaZtrjTDMYAPlBoKWNgLdB5y.jpg", backdrop_path: "/cU0AAUZ1HHpqOkIQPYBjaZxhs61.jpg", title: "Uncle John", vote_avg: 2.0},
  {overview: "A stranger in the increasingly strange city of San Francisco, Japanese crime novelist Aki is unsure of precisely what role she has to play in a real-life murder mystery involving ambiguous MacGuffins and amorphous identities. Unfolding in lonely places such as bookshops and hotel bars, Dave Boyle's moody thriller uncovers exhilarating new takes on genre conventions. Consequently, it's an alluring l'homme fatal who supplies Aki with the breadcrumb trail of clues that entices her into a labyrinthine plot of sinister dealings. In turn, the aging sheriff (veteran character actor Pepe Serna, fantastic in a rare leading role), who should rightfully be riding to her rescue, proves to be equally out of his depth. The game is afoot, the chase is exhilarating and the stakes are perilously high in this inspired neo-noir.", release_date: "2014-06-15", medium: "Movie", unique_id: 272418, original_title: "Man from Reno", poster_path: "/n4CNMTf4OIZdoyDlCkq0UlBBu2I.jpg", backdrop_path: "/i15A89bbBzZ0GeybxvsvK9B9s6.jpg", title: "Man from Reno", vote_avg: 6.5}
])
